                font-weight: 400;

                font-style: normal;
                font-weight: 400;

                background-color: rgba(163, 113, 255);
                border-color: rgba(175, 125, 255);

                color: rgb(255, 0, 85);
                background-color: rgb(242, 219, 224);
                border-color: rgb(246, 193, 204);
                border-style: solid;
            }
        </style>
        <style>
            * {
                -webkit-font-smoothing: antialiased;
            }
        </style>
